/* sect1 */ "删除共享文件夹|||删除共享文件夹¶要删除您拥有的共享文件夹：¶导航到目标文件夹，标识为¶。¶指向项目的功能菜单¶，然后单击¶删除¶。如果¶删除¶不可用，您已经选择与您共享的文件夹、企业文件夹，或来自 Tempo Social 社区的文件库。有关详细信息，请参阅¶、¶或¶。¶这将为您和所有协作者从您的 Tempo Box 文件夹移除该文件夹。这意味着文件夹会从您的所有其他 OpenText Tempo Box 客户端删除，如您的桌面客户端以及智能手机或平板电脑。您也可移除协作者。有关详细信息，请参阅¶。¶单击¶删除¶。¶要移除他人与您共享的文件夹：¶在¶Tempo Box 文件夹的根目录中，找到目标共享文件夹。与您共享的文件夹会将文件夹所有者的用户名附加到文件夹名中。例如，¶营销材料 (jsmith)¶。¶指向项目的功能菜单¶，然后单击¶移除¶。¶您必须删除实际文件夹而不是删除共享文件夹中的内容。删除共享文件夹中的内容将删除包括共享文件夹的所有者在内的所有协作者的内容。¶单击¶移除¶。¶此操作将断开与共享文件夹的连接，并从您的¶Tempo Box 文件夹中将其移除。此操作不会删除所有者或其他协作者的文件夹。¶要删除企业文件夹：¶在¶Tempo Box 文件夹的根目录中，找到目标企业文件夹。企业文件夹标识为¶或¶。¶指向项目的功能菜单¶，然后单击¶移除¶。¶您必须删除实际文件夹而不是删除企业文件夹中的内容。删除企业文件夹中的内容将删除已经订阅该文件夹的所有协作者的内容，以及删除企业工作区中的文件夹的内容。¶单击¶移除¶。¶此操作将断开与该文件夹的连接，并从您的¶Tempo Box 文件夹中将其移除。这不会删除企业工作区中的文件夹。如果您意外删除了企业文件夹，请导航到企业工作区中的文件夹，并再次添加该文件夹。有关将企业文件夹添加到您的 Tempo Box 文件夹的更多信息，请参阅¶。¶要从 Tempo Social 社区移除文件库：¶在¶Tempo Box 文件夹的根目录中，找到目标文件夹。社区文件夹标识为¶或¶。¶指向项目的功能菜单¶，然后单击¶移除¶。¶单击¶移除¶。¶此操作将断开与文件库的连接，并从您的¶Tempo Box 文件夹中将其移除。此操作不会删除 Tempo Social 中的文件库。如果您意外删除了文件库，请导航到 Tempo Social 中的社区，离开然后重新加入该社区。有关 Tempo Social 社区的更多信息，请参阅¶。¶|syncpcwb-delete-shared-folder-p.htm",

